var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': 'website', 'text': 'Github: https://github.com/40923105/cp2020/ \n', 'tags': '', 'url': 'website.html'}, {'title': 'H1', 'text': '', 'tags': '', 'url': 'H1.html'}, {'title': 'PCH 1 - External Components of the Desktop System Unit (台式機系統單元的外部組件)', 'text': 'The lab activity below is designed to help you locate and understand the purpose of the various bays and ports on a desktop PC system unit. To identify components, move your mouse pointer over the name of the component or the image. Then be sure to click on each component to see a detailed view. In the detailed view, you will be able to examine the cables of various peripherals. You also will be able to see the most common bays and the way peripherals fit into them. \n 下面的實驗活動旨在幫助您查找和了解台式PC系統單元上各種托架和端口的用途。要識別組件，請將鼠標指針移到組件或圖像的名稱上。然後，請確保單擊每個組件以查看詳細視圖。在詳細視圖中，您將能夠檢查各種外圍設備的電纜。您還將能夠看到最常見的托架以及外圍設備裝入它們的方式。 \n \n A:Power button (電源按鈕) B:Memory card reader bay (存儲卡讀取器托架) C:CD/DVD drive (CD / DVD驅動器) \n \n D:USB ports (USB端口) E:Microphone jack (input) (麥克風插孔（輸入）) F: Headphone jack (output) (耳機插孔（輸出）) \n \n G: FireWire 400 port (FireWire 400端口) \n', 'tags': '', 'url': 'PCH 1 - External Components of the Desktop System Unit (台式機系統單元的外部組件).html'}, {'title': 'PCH 1 - Connections Between Common Peripherals and Standard Ports(通用外圍設備和標準端口之間的連接)', 'text': 'The peripherals connect to the computer via standard ports. Ports allow for information to flow into or out of the computer as part of the input and output subsystems. External devices, such as keyboards, mice, printers, scanners, storage devices, monitors, and others can connect to the computer through various types of cables, which connect to specific ports. On most modern systems, this has been reduced down to a common, standard interface, the universal serial bus port (USB port). Older systems have various ports for various functions, which are now referred to as legacy ports, such as PS/2, serial, and parallel ports. They were difficult to configure and required hardware resources to be dedicated to them, such as interrupt requests, direct memory access, and specific I/O (input/output) port addresses. In USB, this is all handled by the operating system automatically. This makes hardware conflicts rare in current systems. Many customers will still have computers with legacy ports. So, it is important to understand multiple ports and connections. \n The photo below offers a close-up view of a motherboard’s port cluster. \n 外圍設備通過標準端口連接到計算機。端口允許信息作為輸入和輸出子系統的一部分流入或流出計算機。外部設備（例如鍵盤，鼠標，打印機，掃描儀，存儲設備，監視器和其他設備）可以通過連接到特定端口的各種類型的電纜連接到計算機。在大多數現代系統上，這已簡化為通用的標準接口，即通用串行總線端口（USB端口）。較舊的系統具有用於各種功能的各種端口，這些端口現在稱為傳統端口，例如PS / 2，串行和並行端口。它們很難配置，並且需要專用於它們的硬件資源，例如中斷請求，直接內存訪問和特定的I / O（輸入/輸出）端口地址。在USB中，這全部由操作系統自動處理。這使得在當前系統中很少發生硬件衝突。許多客戶仍將擁有帶有舊端口的計算機。因此，了解多個端口和連接很重要。 \n 下圖提供了主板端口集群的特寫視圖。 \n \n The chart below describes the functions of the ports depicted in the image above. \n 下表描述了上圖中描繪的端口的功能。 \n \n \n \n PORT (接口) \n \n NAME ( 名稱 ) \n \n FUNCTION ( 功能 ) \n \n \n A \n PS/2 \n Used to connect keyboards and mice. ( 用於連接鍵盤和鼠標。) \n \n \n B \n USB \n Used to connect external devices with a \xa0 universal serial bus \xa0 (USB) connector, such as mice, keyboards, printers, and storage devices. ( 用於通過 通用串行總線 （USB）連接器 連接外部設備 ，例如鼠標，鍵盤，打印機和存儲設備。 ) \n \n \n C \n \n S/PDIF Optical \n ( S / PDIF光學 ) \n \n \n Used to connect digital high-fidelity audio systems. \n ( 用於連接數字高保真音頻系統。 ) \n \n \n D \n \n HDMI \n ( HDMI接口 ) \n \n \n Used to connect a \xa0 high-definition multimedia interface \xa0 (HDMI).  \n ( 用於連接 高清多媒體接口\xa0 （HDMI）。 ) \n \n \n \n E \n VGA ( 顯卡 ) \n \n Used to connect a \xa0 video graphics array \xa0 (VGA) display device. \n ( 用於連接 視頻圖形陣列 （VGA）顯示設備。 ) \n \n \n \n F \n DVI \n \n Used to connect a \xa0 digital video interface \xa0 (DVI) display device. \n ( 用於連接 數字視頻接口 （DVI）顯示設備。 ) \n \n \n \n G \n USB \n Used to connect external devices with a \xa0 universal serial bus \xa0 (USB) connector, such as mice, keyboards, printers, and storage devices. ( 用於通過 通用串行總線 （USB）連接器 連接外部設備 ，例如鼠標，鍵盤，打印機和存儲設備。 ) \n \n \n H \n IEEE 1394 \n Used to connect external FireWire devices, such as hard drives and cameras. ( 用於連接外部FireWire設備，例如硬盤驅動器和相機。 ) \n \n \n I \n RJ-45 \n Used to connect to an Ethernet network. ( 用於連接到以太網。 ) \n \n \n J \n USB \n Used to connect external devices with a \xa0 universal serial bus \xa0 (USB) connector, such as mice, keyboards, printers, and storage devices. ( 用於通過 通用串行總線 （USB）連接器 連接外部設備 ，例如鼠標，鍵盤，打印機和存儲設備。 ) \n \n \n K \n Audio (音訊) \n Used to connect to a speaker system. ( 用於連接揚聲器系統。 ) \n \n \n', 'tags': '', 'url': 'PCH 1 - Connections Between Common Peripherals and Standard Ports(通用外圍設備和標準端口之間的連接).html'}]};